import React from 'react';
import { motion } from 'framer-motion';
import { FaRocket, FaCloud, FaShieldAlt, FaExpandArrowsAlt } from 'react-icons/fa';

const FeatureCard = ({ title, description, icon: Icon }) => (
  <motion.div 
    className="bg-gray-800 bg-opacity-30 p-8 rounded-lg backdrop-filter backdrop-blur-sm"
    initial={{ opacity: 0, y: 20 }}
    whileInView={{ opacity: 1, y: 0 }}
    transition={{ duration: 0.5 }}
  >
    <Icon className="w-8 h-8 text-indigo-400 mb-4" />
    <h3 className="text-xl font-semibold text-white mb-2">{title}</h3>
    <p className="text-gray-400">{description}</p>
  </motion.div>
);

const Info2 = () => {
  const features = [
    { title: "AI Integration", description: "Seamlessly integrate AI into your workflows", icon: FaRocket },
    { title: "Cloud Optimization", description: "Optimize your cloud infrastructure for peak performance", icon: FaCloud },
    { title: "Secure Development", description: "Build with security at the forefront", icon: FaShieldAlt },
    { title: "Scalable Architecture", description: "Design systems that grow with your business", icon: FaExpandArrowsAlt },
  ];

  return (
    <div className="min-h-screen bg-gradient-to-br from-gray-900 to-black text-white py-24 px-4 sm:px-6 lg:px-8">
      <div className="max-w-7xl mx-auto">
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          className="text-center mb-20"
        >
          <h2 className="text-4xl font-bold mb-4 bg-clip-text text-transparent bg-gradient-to-r from-indigo-400 to-purple-500">
            Empowering Your Digital Transformation
          </h2>
          <p className="text-xl text-gray-400 max-w-2xl mx-auto">
            Revolutionize your software development process with TokTok's cutting-edge solutions.
          </p>
        </motion.div>

        <div className="grid grid-cols-1 md:grid-cols-2 gap-12">
          {features.map((feature, index) => (
            <FeatureCard key={index} {...feature} />
          ))}
        </div>

        <motion.div
          initial={{ opacity: 0, y: 20 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          className="mt-24 text-center"
        >
          <h3 className="text-2xl font-semibold mb-6">Ready to Transform Your Development Process?</h3>
          <motion.button 
            className="bg-indigo-600 text-white px-8 py-3 rounded-full font-medium text-lg hover:bg-indigo-700 transition-colors"
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
          >
            Get Started Now
          </motion.button>
        </motion.div>
      </div>
    </div>
  );
};

export default Info2;
